addEventListener("fetch",e=>{e.respondWith(handle(e.request))});async function handle(e){try{const e=await fetch("https://api.coingecko.com/api/v3/simple/price?ids=ethereum&vs_currencies=usd");const n=await e.json();const t=n.ethereum.usd;return new Response(t)}catch(e){console.log(e);return new Response("Error fetching eth price")}}